import React from 'react'
import CardMesure from './CardMesure'

class Mesures extends React.Component {
	render() {
		return (
			<div className="fluid">
				<div className="row">
					<div className="col s12 m4">
						<CardMesure
							color={'#ffa000'}
							max={220}
							value={220}
							label={'U2eff(V)'}
						/>
					</div>

					<div className="col  s12 m4">
						<CardMesure
							color={'#ffa000'}
							max={10}
							value={0.3}
							label={'I1eff(A)'}
						/>
					</div>

					<div className="col s12 m4">
						<CardMesure
							color={'#ffa000'}
							max={10}
							value={10}
							label={'I2eff(A)'}
						/>
					</div>

					<div className="col s12 m4">
						<CardMesure
							color={'#ff6f00'}
							max={2000}
							value={232.45}
							label={'P1(W)'}
						/>
					</div>

					<div className="col s12 m4">
						<CardMesure
							color={'#ff6f00'}
							max={2000}
							value={1000}
							label={'P2(W)'}
						/>
					</div>

					<div className="col s12 m4">
						<CardMesure
							color={'#ff6f00'}
							max={100}
							value={90}
							label={'Rendement(%)'}
						/>
					</div>
				</div>
			</div>
		)
	}
}

export default Mesures
